import React, { useEffect, useState } from 'react';
import { Card, Container, Row, Col, Button, ListGroup, Badge, Table, Spinner } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { userAPI } from '../services/api';

const BoardAdmin = () => {
  const [users, setUsers] = useState([]);
  const [loadingUsers, setLoadingUsers] = useState(true);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const res = await userAPI.getAll();
        setUsers(res.data);
      } catch (error) {
        console.error('Failed to fetch users:', error);
      } finally {
        setLoadingUsers(false);
      }
    };

    fetchUsers();
  }, []);

  const countByRole = (role) => users.filter((u) => u.role === role).length;

  return (
    <Container className="mt-4">
      <h2>Admin Dashboard</h2>
      <p className="text-muted">Full system administration and management.</p>

      <Row>
        <Col md={6}>
          <Card className="mb-4">
            <Card.Header>
              <h5>ðŸ‘¥ User Summary</h5>
            </Card.Header>
            <Card.Body>
              {loadingUsers ? (
                <Spinner animation="border" />
              ) : (
                <ListGroup variant="flush">
                  <ListGroup.Item>
                    <strong>Total Users:</strong> {users.length}{' '}
                    <Badge bg="info" className="ms-2">Active</Badge>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Members:</strong> {countByRole('MEMBER')}{' '}
                    <Badge bg="success" className="ms-2">Active</Badge>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Trainers:</strong> {countByRole('TRAINER')}{' '}
                    <Badge bg="primary" className="ms-2">Active</Badge>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Staff:</strong> {countByRole('STAFF')}{' '}
                    <Badge bg="warning" className="ms-2">Active</Badge>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Admins:</strong> {countByRole('ADMIN')}{' '}
                    <Badge bg="danger" className="ms-2">Active</Badge>
                  </ListGroup.Item>
                </ListGroup>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Optional: Table to list all users */}
      <Row className="mt-4">
        <Col>
          <Card>
            <Card.Header>
              <h5>ðŸ“‹ All Users</h5>
            </Card.Header>
            <Card.Body>
              {loadingUsers ? (
                <div className="text-center">
                  <Spinner animation="border" /> Loading users...
                </div>
              ) : (
                <Table striped bordered hover responsive>
                  <thead>
                    <tr>
                      <th>ID</th>
                      <th>Username</th>
                      <th>Name</th>
                      <th>Email</th>
                      <th>Role</th>
                    </tr>
                  </thead>
                  <tbody>
                    {users.map((u) => (
                      <tr key={u.id}>
                        <td>{u.id}</td>
                        <td>{u.username}</td>
                        <td>{u.firstName} {u.lastName}</td>
                        <td>{u.email}</td>
                        <td>
                          <Badge bg={
                            u.role === 'ADMIN' ? 'danger' :
                            u.role === 'TRAINER' ? 'primary' :
                            u.role === 'STAFF' ? 'warning' :
                            u.role === 'MEMBER' ? 'success' : 'secondary'
                          }>
                            {u.role}
                          </Badge>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </Table>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default BoardAdmin;
